con:config.script:
import org.openqa.selenium.WebDriver
import org.openqa.selenium.TakesScreenshot
import org.openqa.selenium.chrome.ChromeDriver
import org.openqa.selenium.chrome.ChromeOptions

def driver = null

try {

    System.setProperty("webdriver.chrome.driver", testRunner.testCase.testSuite.project.getPropertyValue("PATH_TO_DRIVER"))
    System.setProperty("webdriver.chrome.verboseLogging", "true")

    def options = new ChromeOptions()
    options.addArguments("--headless")
    options.addArguments("--no-sandbox")
    options.addArguments("--disable-dev-shm-usage")

    driver = new ChromeDriver(options)

    driver.get("https://www.google.com/")

    assert driver.getTitle() == "Google"

} catch (Exception e) {

    log.error("An error occurred at " + testRunner.testCase.name + " : " + e.getMessage())
    testRunner.fail()

} finally {

    if (driver != null) {

        driver.quit()

    }
}
